Parses.Sparql:
#MANUAL SPARQL
PREFIX ns: <http://rdf.freebase.com/ns/>
SELECT DISTINCT ?x 
WHERE {
	FILTER (?x != ns:m.01znc_)
	{ 
	  ns:m.01znc_ ns:location.statistical_region.places_exported_to ?y .
	  ?y ns:location.imports_and_exports.exported_to ?x . 
	}
	UNION
	{
	  ns:m.01znc_ ns:location.statistical_region.places_imported_from ?y .
	  ?y ns:location.imports_and_exports.imported_from ?x . 
	}
}

#MANUAL SPARQL
PREFIX ns: <http://rdf.freebase.com/ns/>
SELECT DISTINCT ?x
WHERE {
  ns:m.06x5s ns:time.recurring_event.instances ?x . # Super Bowl instances

  {
    ?x ns:sports.sports_championship_event.champion ns:m.05gg4 . # giants
  }
  UNION
  {
    ?x ns:sports.sports_championship_event.runner_up ns:m.05gg4 . # giants
  }
  ?x ns:time.event.start_date ?st .
}
ORDER BY DESC(xsd:datetime(?st))
LIMIT 1

#MANUAL SPARQL
PREFIX ns: <http://rdf.freebase.com/ns/>
SELECT DISTINCT ?x
WHERE {
  {
    ns:m.0by0ww1 ns:sports.sports_championship_event.champion ?x .
  }
  UNION
  {
    ns:m.0by0ww1 ns:sports.sports_championship_event.runner_up ?x . 
  }
}
